script: |
  super -f text -I q8594.spq | sort > q8594.out

inputs:
  - name: q8594.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + col2 + + col0 * - + 96 * + - col2 * + col2 / - - 78 = + - 8 + + - ( col2 ) AND 51 NOT IN ( + 51 * 96 + - col1, - ( col1 ), ( + + col2 ) * - col2 * - col1, col0 );
  - name: tab2

outputs:
  - name: q8594.out
    data: |
